.card .content {
   padding: 20px;
   display: flex;
   flex-direction: row;
   align-items: center;
   justify-content: space-around;
   height: 100%;
   box-sizing: border-box;
}

.card .content .column {
   display: flex;
   flex-direction: column;    
   justify-content: space-around;
   height: 100%;
}

.card h1 {
    text-transform: uppercase;
    color: #999;
    font-size: 20px;
    font-weight: bold;
    margin: 0;
    padding-bottom: 10px;
    line-height: 32px;
}

.card .value {
    font-size: 38px;
    font-weight: 200;
}

.card .description {
    font-size: 20px;
    color: #999;
}

.navbar {
    list-style-type: none;
    height: 100%;
}

.navbar a {
    height: 100%;
    float: left;
    padding: 0 15px 0 15px;
    margin: 0 5px 0 5px;
    color: black;
    color: rgba(0, 0, 0, 0.87);
    text-decoration: none;
    text-align: center;
    text-transform: uppercase;
    display:flex;
    justify-content:center;
    align-items:center;
}

.navbar a:hover {
    color: black;
    color: rgba(0, 0, 0, 0.87);
    background-color: #e0e0e0;
    -moz-border-radius: 5px 5px 5px 5px;
    -webkit-border-radius: 5px 5px 5px 5px;
    border-radius: 5px 5px 5px 5px;
    border: 0 solid #e0e0e0;
}

.active {
    color: #fafafa !important;
    background-color: #f44336 !important;
    -moz-border-radius: 5px 5px 5px 5px;
    -webkit-border-radius: 5px 5px 5px 5px;
    border-radius: 5px 5px 5px 5px;
}

.material-icons {
    font-size: 20px;
    padding-right: 5px;
}

[data-md-tooltip] {
    position: relative;
}

@media screen and (max-width : 960px){
    .menutext {
        display: none;
    }

    [data-md-tooltip]:before {
        content: attr(data-md-tooltip);
        position: absolute;
        bottom: -35px;
        left: 50%;
        padding: 8px;
        transform: translateX(-50%) scale(0);
        transition: transform 0.3s ease-in-out;
        transform-origin: top;
        background: #616161e6;
        color: white;
        border-radius: 2px;
        font-size: 12px;
    }

    [data-md-tooltip]:hover:before {
        transform: translateX(-50%) scale(1);
    }

    .material-icons {
        font-size: 28px;
    }
}

settings.colorFunction:
var type = dsData[dsIndex]['Type'];
if (type == 'colorpin') {
	var temperature = dsData[dsIndex]['temperature'];
	if (typeof temperature !== undefined) {
	    var percent = (temperature + 60)/120 * 100;
	    return tinycolor.mix('blue', 'red', percent).toHexString();
	}
	return 'blue';
}

